import React, { Component } from 'react';

class CSGOButton extends Component{
	render(){
		return(
			<button onclick="window.location.href = 'https://w3docs.com';"><img src={require('../Images/csgologo.png')} width="70" height = "70" alt=""/></button>
		);
	}
}

export default CSGOButton;
